import React, { Component } from 'react'
import './App.scss';
//import Header from './Header';
//import Books from './Books';
//import Home from './Home';
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
//import Photos from './Photos';
import Footer from './Footer';
import About from './About';
import Quotes from './Quotes';
import Videos from './Videos';
//import FranzStyle from './FranzStyle';
//import Buttons from './Buttons';
//import { makeStyles } from '@material-ui/core/styles';
import HeaderUI from './HeaderUI';
import MainFeaturedPost from './MainFeaturedPost';
//import ButtonsB from './ButtonsB';
import { InstaFollow  } from './InstaFollow';

//import './Footer.scss';

const mainFeaturedPost = {
  title: 'FRANZ KAFKA',
  description:
    "Novelist (1883 – 1924)",
  image: 'https://penguinindiablog.files.wordpress.com/2017/07/franz-kafka-7.png?w=1920',
  imgText: 'main image description',
  linkText: 'Continue reading…',
};


export default class App extends Component {

  render(){
    return(
              <div className="page-container">
              <div className="content-warp">

              <Router>
              <div><main> <MainFeaturedPost post={mainFeaturedPost} /></main> </div>  

              <div> <HeaderUI /></div>    
              <InstaFollow />
              <div>
              <Route path="/about"   component={About}/>
              <Route path="/quotes" component={Quotes}/>
              <Route path="/videos" component={Videos}/>
              </div>
              </Router>
              </div>
              <Footer />
              </div>
       )
  }
}
//export default App;
